import { HttpClientModule } from '@angular/common/http';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { MatInputModule } from '@angular/material/input';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatSidenavModule } from '@angular/material/sidenav';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { MatButtonModule } from '@angular/material/button';
import { MatCheckboxModule } from '@angular/material/checkbox';
import { AppRoutingModule } from './app-routing.module'; 
import { LoginComponent } from './components/account/login.component';
import { NotFoundComponent } from './components/not-found.component';
import { LogoutComponent } from './components/account/logout.component';
import { AppComponent } from './layouts/app.component';
import { LeftPanelComponent } from './layouts/left-panel.component';
import { HeadComponent } from './layouts/head.component';
import { AppConfig } from './config/config';

@NgModule({
    imports: [
      BrowserModule,
      BrowserAnimationsModule,
      MatButtonModule, 
      MatCheckboxModule,
      MatInputModule,
      MatFormFieldModule,
      MatSidenavModule,
      AppRoutingModule,
      HttpClientModule,
    ],
   declarations: [
      AppComponent,
      LeftPanelComponent,
      HeadComponent,
      LoginComponent,
      LogoutComponent,
      NotFoundComponent
    ],
    bootstrap: [AppComponent],
    providers: [AppConfig]
})
export class AppModule { }
